import React from 'react';
import { useNavigate } from 'react-router-dom';
import PostList from '../components/PostList.js';
import { Link } from 'react-router-dom';
import '../style.css';

const Home = () => {
  const navigate = useNavigate();
  const token = localStorage.getItem('token');
  
  if (!token) {
    navigate('/login');
  }

  return (
    <div className="home-container">
      {/* Sidebar */}
      <div className="sidebar">
        <h3>Blog</h3>
        <ul>
          <li><a href="#">Tackle Your Biggest Challenges</a></li>
          <li><a href="#">Finding Balance</a></li>
          <li><a href="#">Innovation Examples</a></li>
        </ul>

        <div className="following">
          <h3>I'm Following</h3>
          <div className="following-list">
            {/* Replace with images of people */}
            <img src="person1.jpg" alt="person1" className="following-img" />
            <img src="person2.jpg" alt="person2" className="following-img" />
            <img src="person3.jpg" alt="person3" className="following-img" />
          </div>
        </div>
      </div>

      {/* Main Content */}
      <div className="main-content">
        <div className="post-form">
          <h1>What's on your mind?</h1>
          <textarea placeholder="Share something..."></textarea>
          <button className="button">Post</button>
        </div>

        <PostList />
      </div>

      {/* Right Sidebar */}
      <div className="right-sidebar">
        <h3>Latest Updates</h3>
        <ul>
          <li>John posted an update</li>
          <li>Adele posted a photo</li>
          <li>New group chat in Coffee Addicts</li>
        </ul>
      </div>
    </div>
  );
};

export default Home;
